import  '../';

function LandingPage() {
  return (
    <div className="LandingPage">
          <header className="header__container text text__bright">
              <h1 className="banner__title">Hi! I'm Cosmina</h1>
              <h2 className="banner__subtitle">I'm a fullstack web developer</h2>
          </header>
    </div>
  );
}

export default LandingPage;
